import React from "react";
import { Helmet } from "react-helmet";
// import "./chart";
import Content from "./content";
import Sidebar from "./sidebar";
import "./index.css";
import "./basscss.css";
import myHead from "./myHead";
// import "./reading";

function App() {
  return (
    <myHead>
      <div className="background shadow-2 flex overflow-hidden">
        <Sidebar />
        <Content />
      </div>
    </myHead>
  );
}

export default App;
